import { ReactDOM } from "react";
import { SocialIcon } from "react-social-icons";

const Footer = () => {
    return (
        <>
      <div className="footer">
        <div className="footer-column">
              <div className="copy-right"> 
                &copy; 2023 Roniel Overton
              </div>
          </div>
      </div>

        </>
    )
}
export default Footer
